import React from 'react'
import { NavLink } from 'react-router-dom'
import cls from './NoAuth.module.scss'

const NoAuth = ({
  textContent,
  textLink,
  link,
}) => {
  return (
    <div className={cls.root}>
      <div>
        <img src="img/no-account.jpg" alt="" />
        <h1>{textContent}</h1>
        <NavLink to={link}>{textLink}</NavLink>
      </div>
    </div>
  )
}

export default NoAuth
